import React, { useEffect, useState } from "react";
import AddShoppingCartOutlinedIcon from "@mui/icons-material/AddShoppingCartOutlined";
import FavoriteBorderOutlinedIcon from "@mui/icons-material/FavoriteBorderOutlined";
import BalanceOutlinedIcon from "@mui/icons-material/BalanceOutlined";
import "./Products.scss";
import useFetched from "../../hook/useFetched";
import { useParams } from "react-router-dom";
import { useDispatch } from "react-redux";
import { addToCart } from "../../redux/cartReducer";
import axios from "axios";

const Products = () => {

  const [data,setData]=useState([])
  const [error, setError] = useState(false);
  const [loding, setLoding] = useState(false);

  const id = useParams().id;
  useEffect(()=>{
    try{
      const getData=async()=>{
        setLoding(true)
          const datos = await axios.get("http://localhost:4000/products")
          setData(datos)
      }
    }catch(err)
    {
      setError(true)
    }
    setLoding(false)
    getData()
  },[])


  console.log(data.find(it=> it._id == id));

  const [index, setIndex] = useState(0);
  const [quantity, setQuantity] = useState(1);

  const dispatch = useDispatch();
  return (
    <div className="">
      {data.map((item) => {
        return (
          <div key={item.id}>
            {loading ? (
              "loading..."
            ) : (
              <div className="products" key={item.id}>
                <div className="left">
                  <div className="images">
                    <img
                      src={
                        process.env.REACT_APP_API_URL_IMG +
                        item.attributes.img.data.attributes.url
                      }
                      alt="D"
                      onClick={() =>
                        setIndex(
                          process.env.REACT_APP_API_URL_IMG +
                            item.attributes.img.data.attributes.url
                        )
                      }
                    />
                    {item?.attributes?.img2?.data?.attributes?.url && (
                      <img
                        src={
                          process.env.REACT_APP_API_URL_IMG +
                          item?.attributes?.img2?.data?.attributes?.url
                        }
                        alt="D"
                        onClick={() =>
                          setIndex(
                            process.env.REACT_APP_API_URL_IMG +
                              item?.attributes?.img2?.data?.attributes?.url
                          )
                        }
                      />
                    )}
                  </div>
                  <img
                    className="mainImg"
                    src={
                      index ||
                      process.env.REACT_APP_API_URL_IMG +
                        item.attributes.img.data.attributes.url
                    }
                    alt="index"
                  />
                </div>
                <div className="right">
                  <h1>{item.attributes.title} </h1>
                  <span className="price">${item.attributes.price}</span>
                  <p className="desc">{item.attributes.desc}</p>
                  <div className="buttons">
                    <button
                      onClick={() =>
                        setQuantity((prev) => (prev < 2 ? 1 : prev - 1))
                      }
                    >
                      -
                    </button>
                    {quantity}
                    <button onClick={() => setQuantity((prev) => prev + 1)}>
                      +
                    </button>
                  </div>
                  <button
                    className="cart"
                    onClick={() =>
                      dispatch(
                        addToCart({
                          id: item.id,
                          title: item.attributes.title,
                          desc: item.attributes.desc,
                          price: item.attributes.price,
                          img: item.attributes.img.data.attributes.url,
                          quantity,
                        })
                      )
                    }
                  >
                    <AddShoppingCartOutlinedIcon /> ADD TO CART
                  </button>
                  <div className="links">
                    <div className="item">
                      <FavoriteBorderOutlinedIcon /> ADD TO WISH LIST
                    </div>
                    <div className="item">
                      <BalanceOutlinedIcon /> ADD TO COMPARE
                    </div>
                  </div>
                  <div className="info">
                    <span>Vendor: Polo</span>
                    <span>Product Type: T-shirt</span>
                    <span>Tag: T-shrit, Women, Top</span>
                  </div>
                  <hr />
                  <div className="details">
                    <span>DESCRIPTION</span>
                    <span>ADDITIONAL INFORMATION</span>
                    <span>FAQ</span>
                  </div>
                </div>
              </div>
            )}
          </div>
        );
      })}
    </div>
  );
};

export default Products;
